import React, { Component } from "react";

class BreakController extends Component {
  state = {};
  render() {
    return (
      <div>
        <button> + </button>
        <span> /BREAKTIME/ </span>
        <button> - </button>
      </div>
    );
  }
}

export default BreakController;
